import React from "react";
import { useParams, useNavigate } from "react-router-dom";
import "./profileDetail.css";
import { entrepreneurs, landowners, suppliers, skilledLabor } from "./data";

const ProfileDetails = () => {
  const { category, id } = useParams();
  const navigate = useNavigate();

  const dataMap = {
    entrepreneurs,
    landowners,
    suppliers,
    skilledLabor
  };

  const profile = dataMap[category]?.find(item => item.id === parseInt(id));

  if (!profile) {
    return <div className="profile-detail-container"><h2>Profile Not Found</h2></div>;
  }

  return (
    <div className="profile-detail-container">
      <div className="profile-card">
        <h2>{profile.name}</h2>
        {category === "entrepreneurs" && (
          <>
            <p><b>Business:</b> {profile.business}</p>
            <p><b>Location:</b> {profile.location}</p>
            <p><b>Email:</b> {profile.email}</p>
          </>
        )}
        {category === "landowners" && (
          <>
            <p><b>Location:</b> {profile.location}</p>
            <p><b>Size:</b> {profile.size}</p>
            <p><b>Contact:</b> {profile.contact}</p>
          </>
        )}
        {category === "suppliers" && (
          <>
            <p><b>Industry:</b> {profile.industry}</p>
            <p><b>Location:</b> {profile.location}</p>
            <p><b>Contact:</b> {profile.contact}</p>
          </>
        )}
        {category === "skilledLabor" && (
          <>
            <p><b>Skill:</b> {profile.skill}</p>
            <p><b>Experience:</b> {profile.experience} years</p>
            <p><b>Location:</b> {profile.location}</p>
            <p><b>Contact:</b> {profile.contact}</p>
          </>
        )}
      </div>
      <button className="back-button" onClick={() => navigate(-1)}>Back</button>
    </div>
  );
};

export default ProfileDetails;
